 	sip_initSipFromHeader(&(pSipFromHeaderTemp), pError);
 	if(pSipFromHeaderTemp == SIP_NULL) 		 return 0;
 	/*  deSerializing String Single */ 

 	/* retrieve the ID field */ 
 	memcpy(&idElement,&buffer[position],sizeof(SIP_U16bit));
 	position = position + sizeof(SIP_U16bit);
 	objectid = SIP_ntohs(idElement);
